def __getitem__(self, key):
    key = com.apply_if_callable(key, self)
    if key is Ellipsis:
        return self
    key_is_scalar = is_scalar(key)
    if isinstance(key, (list, tuple)):
        key = unpack_1tuple(key)
    if is_integer(key) and self.index._should_fallback_to_positional():
        return self._values[key]
    elif key_is_scalar:
        return self._get_value(key)
    if isinstance(key, tuple) and is_hashable(key) and isinstance(self.index, MultiIndex):
        try:
            result = self._get_value(key)
            return result
        except KeyError:
            return self._get_values_tuple(key)
    if is_iterator(key):
        key = list(key)
    if com.is_bool_indexer(key):
        key = check_bool_indexer(self.index, key)
        key = np.asarray(key, dtype=bool)
        return self._get_values(key)
    return self._get_with(key)

def _get_with(self, key):
    if isinstance(key, slice):
        slobj = self.index._convert_slice_indexer(key, kind='getitem')
        return self._slice(slobj)
    elif isinstance(key, ABCDataFrame):
        raise TypeError('Indexing a Series with DataFrame is not supported, use the appropriate DataFrame column')
    elif isinstance(key, tuple):
        return self._get_values_tuple(key)
    elif not is_list_like(key):
        return self.loc[key]
    if not isinstance(key, (list, np.ndarray, ExtensionArray, Series, Index)):
        key = list(key)
    if isinstance(key, Index):
        key_type = key.inferred_type
    else:
        key_type = lib.infer_dtype(key, skipna=False)
    if key_type == 'integer':
        if not self.index._should_fallback_to_positional():
            return self.loc[key]
        else:
            return self.iloc[key]
    if isinstance(key, list):
        return self.loc[key]
    return self.reindex(key)

def _get_values_tuple(self, key):
    if com.any_none(*key):
        with warnings.catch_warnings():
            warnings.filterwarnings('ignore', 'Support for multi-dim', DeprecationWarning)
            return self._get_values(key)
    if not isinstance(self.index, MultiIndex):
        raise ValueError('Can only tuple-index with a MultiIndex')
    indexer, new_index = self.index.get_loc_level(key)
    return self._constructor(self._values[indexer], index=new_index).__finalize__(self)

def _get_values(self, indexer):
    try:
        return self._constructor(self._mgr.get_slice(indexer)).__finalize__(self)
    except ValueError:
        return self._values[indexer]

def __setitem__(self, key, value):
    key = com.apply_if_callable(key, self)
    cacher_needs_updating = self._check_is_chained_assignment_possible()
    if key is Ellipsis:
        key = slice(None)
    try:
        self._set_with_engine(key, value)
    except (KeyError, ValueError):
        values = self._values
        if is_integer(key) and (not self.index.inferred_type == 'integer'):
            values[key] = value
        else:
            self.loc[key] = value
    except TypeError as e:
        if isinstance(key, tuple) and (not isinstance(self.index, MultiIndex)):
            raise ValueError('Can only tuple-index with a MultiIndex') from e
        if com.is_bool_indexer(key):
            key = check_bool_indexer(self.index, key)
            key = np.asarray(key, dtype=bool)
            try:
                self._where(~key, value, inplace=True)
            except InvalidIndexError:
                self.iloc[key] = value
            return
        else:
            self._set_with(key, value)
    if cacher_needs_updating:
        self._maybe_update_cacher()

def _set_with(self, key, value):
    if isinstance(key, slice):
        indexer = self.index._convert_slice_indexer(key, kind='getitem')
        self.iloc[indexer] = extract_array(value, extract_numpy=True)
    else:
        assert not isinstance(key, tuple)
        if is_scalar(key):
            key = [key]
        if isinstance(key, Index):
            key_type = key.inferred_type
            key = key._values
        else:
            key_type = lib.infer_dtype(key, skipna=False)
        if key_type == 'integer':
            if not self.index._should_fallback_to_positional():
                self.loc[key] = value
            else:
                self.iloc[key] = value
        else:
            self.loc[key] = value

